import { connect } from 'react-redux';
import rentPage from '../Component/rentPageScreen/index';
import { changeName, changeAge } from '../Action/index';

const mapStateToProps = (state) => {
  console.log(state);
  return {
    store: state,
  };
};

const mapDispatchToProps = dispatch => ({
  changeName(nameText) {
    dispatch(changeName(nameText));
  },
  changeAge(ageText) {
    dispatch(changeAge(ageText));
  },
});


export default connect(mapStateToProps, mapDispatchToProps)(rentPage);
